import { StrictMode } from "react";
import { NavVertical } from "../../components/Nav";
import { RoutesConcepts } from "../../routes";

export const ConceptsPage = () => {
  return (
    <StrictMode>
        <section>
          <nav className="nav-vertical">
            <NavVertical />
          </nav>
        </section>
        <RoutesConcepts/>
    </StrictMode>
  );
};
